import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import Header from './component/Navigation/Header';
import Nav from './component/Navigation/Nav';

function App() {
  return (

     <Routes>
      <Route path='/h' element={<Header/>}/>
      <Route path='/' element={<Nav/>}/>


    </Routes>


  );
}

export default App;
